            "body_html": "<ul>\n<li dir=\"ltr\">\n<span>Your babyâ€™s <strong>1st langot</strong> should feel truly special.</span><b></b>\n</li>\n<li dir=\"ltr\">\n<span>Thatâ€™s why <strong>SuperBottoms</strong> created the <strong>DryFeel Langotâ„¢</strong> â€“ to offer your little one the gentle, loving care they deserve from day one. </span><b></b>\n</li>\n<li dir=\"ltr\">\n<span>But worried about constant leaks, messes, and rashes? Donâ€™t be! </span><b></b>\n</li>\n<li dir=\"ltr\">\n<span>This langot is made for <strong>mess-free langot time</strong>, handling pee or poop leaks without creating a mess on the outside</span><b></b>\n</li>\n<li dir=\"ltr\"><span>It keeps your baby clean and comfortable, but remember, it's not a diaper, so youâ€™ll need to change it after one pee to avoid dampness. </span></li>\n<li dir=\"ltr\">\n<span>Made with <strong>premium cotton padding</strong>, itâ€™s <strong>super breathable</strong> and <strong>gentle on your babyâ€™s delicate skin</strong>. Unlike sponge-filled langots that can get mouldy and harbour fungus, our cotton padding keeps your babyâ€™s skin soft and safe.</span><b></b>\n</li>\n<li dir=\"ltr\">\n<span>The innermost layer (the one touching your babyâ€™s bum) has a <strong>Dry Feel Lining</strong> that keeps your babyâ€™s skin comfortable by reducing dampness, so they donâ€™t get fussy or irritated.</span><b></b>\n</li>\n<li dir=\"ltr\">\n<span>Designed with double loops for a secure fit, smooth stitching, and Azo-free safe dyes to protect sensitive skin, the <strong>DryFeel Langotâ„¢</strong> is great for babies from <strong>day 0 to 9 months.</strong></span><b></b>\n</li>\n<li dir=\"ltr\">\n<span>The gentle elastics ensure comfort without leaving marks, providing a snug fit that prevents leaks while allowing your baby to move freely.</span><b></b>\n</li>\n<li dir=\"ltr\">\n<span>Just a heads up: since itâ€™s all fabric, it might take a bit longer to dry. But we believe thatâ€™s a much better option than using a sponge, which isnâ€™t as safe on your babyâ€™s skin.</span><b></b>\n</li>\n<li dir=\"ltr\">\n<span>Before using, remember to give it a wash for the best absorbency. </span><b></b>\n</li>\n<li dir=\"ltr\"><span>Now make your babyâ€™s langot-time mess-free, worry-free and delightful with <strong>SuperBottoms First Love DryFeel Langotâ„¢.</strong></span></li>\n<li>\n<b id=\"docs-internal-guid-275eec4e-7fff-7d27-a3b8-5386ceeb7e0c\"></b>Note: The image is for indicative purposes only. Actual Colour of the Loops and Super DryFeel Layer may be White, basis stock availability. Rest assured, its super performance and functionality remain exactly the same!</li>\n</ul>\n<div style=\"text-align: center;\"><strong><img alt=\"\" src=\"https://cdn.shopify.com/s/files/1/0402/7370/7171/files/pdp1.jpg?v=1703597973\"><br><img src=\"https://cdn.shopify.com/s/files/1/0402/7370/7171/files/2_54c2e595-3b71-4e38-8ca0-9adbea49e464.webp?v=1727262815\" alt=\"\"><br></strong></div>\n<div style=\"text-align: center;\"><strong><img src=\"https://cdn.shopify.com/s/files/1/0402/7370/7171/files/3_86424a79-22ea-476f-bd20-5015ff369fdf.webp?v=1727262815\" alt=\"\"></strong></div>\n<div style=\"text-align: center;\"><strong><img src=\"https://cdn.shopify.com/s/files/1/0402/7370/7171/files/4_081a6a17-cfce-4af4-9c8b-7194bb7547df.webp?v=1727262815\" alt=\"\"><img src=\"https://cdn.shopify.com/s/files/1/0402/7370/7171/files/dfl-new.webp?v=1743020757\" alt=\"\"></strong></div>\n<div style=\"text-align: center;\"></div>\n<p><span style=\"font-weight: 400;\">Not sure about sizing? <a rel=\"noopener\" href=\"https://api.whatsapp.com/send/?phone=7499025345&amp;text=Hi&amp;type=phone_number&amp;app_absent=0\" target=\"_blank\"><span style=\"text-decoration: underline; color: #00aaff;\"><strong>Chat with us</strong></span></a> for assistance.</span></p>\n<!--split-->",
