            "title": "UNO Cloth Diaper Starter Kit with 2 Freesize UNO",
            "handle": "freesize-uno-cloth-diaper-2-trial-kit",
            "body_html": "<p>This SuperBottoms Starter Pack with 2 skin-friendly Freesize UNO Cloth Diaper (New Version), a Pack of 3 Reusable Easy Clean Top Sheets and 2 Booster Pad is ideal for new parents as it contains everything one will need for getting started with the diapering journey.<br><br>Your babyâ€™s soft and sensitive skin deserves the loving protection of SuperBottoms.<br><br>Keep your little one happy and comfortable with the ULTIMATE Cloth Diaper UNO - and its accessories. All in one perfect starter pack!</p>\n<p><br><strong>What is included in this pack? </strong><br>- 2 skin-friendly UNO Cloth Diaper (2 Waterproof Outer)<br>- 2 Dry Feel Magic Pad<br>- 2 Booster Pad<br>- Pack of 3 Coloured Easy Clean Top Sheets<br><br><strong>UNO Print Options:</strong><br>- Combo 1: Hunny Bummy - Mommy Talk<br>- Combo 2: Coloured Skies - Periwinkle<br>- Combo 3: Shruberry - White Warli<br>- Combo 4: Mommy Talk - Purple Love<br>- Combo 5: Cherry Blossom - Good Cat-titude<br>- Combo 6: Paw-sitively Happy - Lil crush<br>- Combo 7: Save the Seas - Cherry Blossom<br>- Combo 8: Alphabet - Colour Pop</p>\n<p>Â </p>\n<p><span></span><span>Say hello toÂ <strong>Indiaâ€™s #1 Cloth Diaper â€“ SuperBottoms Freesize UNO!Â <br><br></strong>Perfect for babies weighing 7â€“17 kg (3m to 3y).<strong><br></strong></span></p>\n<ul>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\"><strong>Made from GOTS-certified organic cotton:</strong><span> Incredibly soft and gentle on your babyâ€™s delicate skin.</span></p>\n</li>\n<li aria-level=\"1\" dir=\"ltr\">\n<p role=\"presentation\" dir=\"ltr\"><strong>Waterproof outer layer</strong><span><strong>:</strong> Effectively contains all messes, keeping your baby comfortable and dry.</span></p>\n</li>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\"><strong>Dry Feel Magic Pad:</strong><span> With 12 layers when folded, it absorbs 4-5 pees efficiently, ensuring quick moisture absorption.</span></p>\n</li>\n<li dir=\"ltr\" aria-level=\"1\">\n<p dir=\"ltr\" role=\"presentation\"><strong>SuperDryFeelâ„¢ layer:</strong><span> Keeps your babyâ€™s bum dry, even after multiple pees.</span></p>\n</li>\n</ul>\n<p><strong><b>Â </b></strong></p>\n<p dir=\"ltr\"><span>For <strong>night time</strong> or <strong>heavy wetters</strong>, add the <strong>Booster Pad </strong>for extra absorbency and longer protection.</span></p>\n<p><strong><b>Â </b></strong></p>\n<p dir=\"ltr\"><span>And the diaper literally grows with your baby! The <strong>SnapEasy* </strong>system with adjustable snaps ensures a custom fit from <strong>3 months to 3 years.Â </strong></span></p>\n<p><strong><b>Â </b></strong></p>\n<p dir=\"ltr\"><strong>Washable and reusable for over 300 uses, youâ€™ll only need 16 diapers over 3 years, costing just â‚¹2 per use. Save money and be eco-friendly!Â </strong><strong><b></b></strong></p>\n<p dir=\"ltr\">Â </p>\n<p dir=\"ltr\"><span>Rest assured, your babyâ€™s next diaper (thatâ€™s us ðŸ˜‰) is FREE from harmful chemicals. No lead, no phthalates, no toxins â€“ just pure organic cotton &amp; a whole lot of love from #TeamOfMoms.Â </span></p>\n<p dir=\"ltr\">Â </p>\n<p dir=\"ltr\"><strong>Please wash before first use for best results.</strong><strong><b></b></strong></p>\n<p dir=\"ltr\"><span><strong>Note:</strong> The Dry Feel Magic Pad may come with a Blue or White SuperDryFeelâ„¢ Layer based on stock availability. Performance remains the same!</span></p>\n<p><br><img alt=\"\" src=\"https://cdn.shopify.com/s/files/1/0402/7370/7171/files/1_b01b743b-1f96-44b9-8b39-e5c74c751a28.webp?v=1716987349\"><img alt=\"\" src=\"https://cdn.shopify.com/s/files/1/0402/7370/7171/files/2_53a56289-25d1-414d-a975-1977d2997f19.webp?v=1716987349\"><img src=\"https://cdn.shopify.com/s/files/1/0402/7370/7171/files/88-212.jpg?v=1680759143\" alt=\"\"><img alt=\"\" src=\"https://cdn.shopify.com/s/files/1/0402/7370/7171/files/4-boostercopy.webp?v=1687240180\"><img alt=\"\" src=\"https://cdn.shopify.com/s/files/1/0402/7370/7171/files/5_355a3f22-057c-4f20-88bb-5e16a71af85d.jpg?v=1660309223\"><img alt=\"\" src=\"https://cdn.shopify.com/s/files/1/0402/7370/7171/files/7_db06a4a3-ea89-4017-b347-da5f18650899.webp?v=1716987349\"><img src=\"https://cdn.shopify.com/s/files/1/0402/7370/7171/files/8_d8bddfba-7f2a-47b1-90c6-cb6b6b884868.jpg?v=1660141939\" alt=\"\"></p>\n<div class=\"popup_main\">\n<div class=\"popup_body\">\n<div class=\"popup_contain\">\n<div class=\"popup_close\"><svg viewbox=\"0 0 40 40\" class=\"icon icon-close\" role=\"presentation\" aria-hidden=\"true\"><path class=\"layer\" d=\"M23.868 20.015L39.117 4.78c1.11-1.108 1.11-2.77 0-3.877-1.109-1.108-2.773-1.108-3.882 0L19.986 16.137 4.737.904C3.628-.204 1.965-.204.856.904c-1.11 1.108-1.11 2.77 0 3.877l15.249 15.234L.855 35.248c-1.108 1.108-1.108 2.77 0 3.877.555.554 1.248.831 1.942.831s1.386-.277 1.94-.83l15.25-15.234 15.248 15.233c.555.554 1.248.831 1.941.831s1.387-.277 1.941-.83c1.11-1.109 1.11-2.77 0-3.878L23.868 20.015z\"></path></svg></div>\n<div class=\"popup_close\"><br></div>\n<div class=\"popup_close\">\n<p>*Disclaimer: The [SnapEasy/ SmartFastening] system ofÂ UNO diaper is a patent pending product.Â <strong><a rel=\"noopener\" href=\"https://superbottoms.com/pages/intellectual-property-disclaimer-uno\" target=\"_blank\"><span class=\"open_popup\">Read More</span></a></strong></p>\n</div>\n</div>\n</div>\n</div>",
