            "body_html": "<p><strong>Contents:</strong><br><span>- 1 Multi-size Newborn Waterproof Outer</span><br><span>- 1 Dry Feel Magic Pad</span></p>\n<p>Â </p>\n<p><span aria-label=\"\" class=\"c-mrkdwn__br\" data-stringify-type=\"paragraph-break\"></span><span><strong>SuperBottoms Newborn UNO</strong> is a reusable and washable cloth diaper that is made of all cloth &amp; no harmful chemicals. It is the softest and gentlest diaper for a newborn baby. It provides the convenience of a disposable diaper with the goodness of cloth.</span></p>\n<p>Â </p>\n<p><span aria-label=\"\" class=\"c-mrkdwn__br\" data-stringify-type=\"paragraph-break\"></span><strong>Features:</strong><br><span>- It consists of 2 parts - a Multi-size Waterproof Outer and a Dry Feel Magic Pad that soaks up the pee with a Super DryFeel layer on top to keep your baby's bum dry.</span><br><span>- Perfect for newborns weighing 2.5â€“7 kg (0 to 3 months).</span><br><span>- The outer layer, made of velvety soft minky, feels smooth on baby's skin.</span><br><span>- It is soft, gentle, breathable, and has a velcro closure for easy wearing.</span><br><span>- The Newborn UNO comes with one Dry Feel Magic Pad.</span></p>\n<p><img alt=\"\" src=\"https://cdn.shopify.com/s/files/1/0402/7370/7171/files/3dweb_4b564824-bb24-4aae-a174-e580d8d34d89.webp?v=1693216588\"></p>\n<p>When folded, the Dry Feel Magic Pad has 9 layers of GOTS Certified 100% Organic Cotton - The Super DryFeel Layer on top keeps babyâ€™s bum dry for â€œstay dryâ€ comfort.<strong><br>Note:</strong> The Dry Feel Magic Pad you receive may have Blue or White coloured Super DryFeel Layer, basis stock availability. Rest assured, its super performance and functionality remain exactly the same!</p>\n<p><img alt=\"\" src=\"https://cdn.shopify.com/s/files/1/0402/7370/7171/files/NB1-PDP_2copy.webp?v=1688710994\"><img alt=\"\" src=\"https://cdn.shopify.com/s/files/1/0402/7370/7171/files/NB1-PDP_3copy.webp?v=1688711027\"><img alt=\"\" src=\"https://cdn.shopify.com/s/files/1/0402/7370/7171/files/NB1-PDP_1copy.webp?v=1688711017\"><br><img alt=\"\" src=\"https://cdn.shopify.com/s/files/1/0402/7370/7171/files/No_chem.jpg?v=1660736089\"><!-- split --></p>\n<p><!-- split --></p>\n<p><!-- split --></p>\n<!-- split -->",
