            "title": "SuperSoft Baby Briefs (Bummy's Galaxy) Pack of 3",
            "handle": "supersoft-baby-briefs-bummys-galaxy-3-pack",
            "body_html": "<p>From a magical land where clouds dance, Bummy and friends bring you the SuperSoft Underwear for kids â€” sooooo soft, feels like a teddy bear hug!</p>\n<p>This kidsâ€™ underwear is 3X softer than regular, made from 95% Bamboo &amp; 5% Elastane, tons of love, and a sprinkle of magic. Itâ€™s super stretchy, breathable, and comfortable.Â </p>\n<p>Why Bamboo? It has natureâ€™s superpowers! With its oh-so-soft feel and breezy touch, feels like it floats on the skin. Its thermoregulatory properties keep your baby cool in summer and warm in winter while fighting off those yucky germs and wicking away moisture. Itâ€™s a fabulous choice for happy bums all day long!</p>\n<p>With cool patterns like baby bloomers and briefs, boys' trunks and briefs, and girls' bloomers, briefs, and boyshorts, there's something for everyone. Made in vibrant colours with CPSIA tested safe, Azo-free dyes.Â </p>\n<p>No more scratchy tags and itchy stitches! Only gentle seams and elastics, paired with joy and comfort with every thread.</p>\n<p><img src=\"https://cdn.shopify.com/s/files/1/0402/7370/7171/files/1_715944fa-dc36-4f64-bc01-6fc623e0d03c.webp?v=1714994480\" alt=\"\"><img src=\"https://cdn.shopify.com/s/files/1/0402/7370/7171/files/2_dfe0b04b-11eb-49e9-b7e6-da37fa8b9a9c.webp?v=1714994480\" alt=\"\"><img src=\"https://cdn.shopify.com/s/files/1/0402/7370/7171/files/3_80856aa8-3aaf-40ef-9935-ce0be2cc91b1.webp?v=1714994480\" alt=\"\"><img src=\"https://cdn.shopify.com/s/files/1/0402/7370/7171/files/4_6181406e-5c6e-4507-9131-09e85e8bfd2a.webp?v=1714994480\" alt=\"\"><img src=\"https://cdn.shopify.com/s/files/1/0402/7370/7171/files/5_78b1916b-b5ea-4ace-b57d-cdab5a961613.webp?v=1714994480\" alt=\"\"><img src=\"https://cdn.shopify.com/s/files/1/0402/7370/7171/files/Wash_website_c18ae959-aba6-4868-9949-781a28735f9c.webp?v=1718959892\" alt=\"\"></p>\n<p dir=\"ltr\"><span><br>Get <strong>FREE Funky Tattoos </strong>with every purchase of <strong>SuperSoft Underwear </strong>and double the fun for your little ones.</span></p>\n<p dir=\"ltr\"><span>These tattoos are temporary, skin-friendly and waterproof, ensuring safe and long-lasting play. Simply peel the transparent film, apply the tattoo design-side down on the skin, press a damp cloth for 20 seconds, and reveal the fun!</span></p>\n<p>Â </p>",
