            "body_html": "<p><strong>Contents: </strong><br>- 2 Multi-size Newborn Waterproof Outer<br>- 2 Dry Feel Magic Pad<br>- 3 Reusable Easy Clean Top Sheet<br><br><strong>SuperBottoms Newborn UNO</strong> is a reusable and washable cloth diaper that is made of all cloth &amp; no harmful chemicals. It is the softest and gentlest diaper for a newborn baby. It provides the convenience of a disposable diaper with the goodness of cloth.</p>\n<p><strong>Prints:Â </strong></p>\n<p>- Combo1: Baby Hearts - Hunny Bummy<br><span>- Combo2:Â </span><span>Fruit Burst</span><span>Â -Â </span><span>Coloured Skies</span><span>Â </span><br><span>- Combo3: Periwinkle - White warli</span><br><span>- Combo4: Cherry Blossom - Ikat chevron</span><br><span>- Combo5: White Warli - Ikat chevron</span></p>\n<p><br>Â <br><strong>Features:</strong><br>- It consists of 2 parts - a Multi-size Waterproof Outer and a Dry Feel Magic Pad that soaks up the pee with a Super DryFeel layer on top to keep your baby's bum dry.<br>- <span data-sheets-value='{\"1\":2,\"2\":\"Your babyâ€™s delicate skin deserves nothing but the best. Give it the gentle protection of soft cotton fabric with our Newborn UNO and Swaddle combo. \\nThis Newborn UNO in Cherry Blossom/White Warli/Periwinkle print is soft and gentle on your babyâ€™s skin and contains no harmful chemicals. Since itâ€™s made of 100% cloth It is washable and reusable 300+ times. \\n\\nWhy is Newborn UNO the best for your baby?\\n- Snug &amp; comfortable fit\\n- Waterproof outer to ensure there there are no leaks \\n- SuperDryFeelâ„¢ layer that touches babyâ€™s bums so that they donâ€™t feel wet\\n- 0 harmful chemicals\\n\\nWrap your newborn baby snugly in the comfort of the softest mulmul cotton with our Knots and Tots Swaddle set. \\nIt can be used as swaddle wrap, baby blanket, burp cloth, and more!\"}' data-sheets-userformat='{\"2\":1021,\"3\":{\"1\":0},\"5\":{\"1\":[{\"1\":2,\"2\":0,\"5\":{\"1\":2,\"2\":0}},{\"1\":0,\"2\":0,\"3\":3},{\"1\":1,\"2\":0,\"4\":1}]},\"6\":{\"1\":[{\"1\":2,\"2\":0,\"5\":{\"1\":2,\"2\":0}},{\"1\":0,\"2\":0,\"3\":3},{\"1\":1,\"2\":0,\"4\":1}]},\"7\":{\"1\":[{\"1\":2,\"2\":0,\"5\":{\"1\":2,\"2\":0}},{\"1\":0,\"2\":0,\"3\":3},{\"1\":1,\"2\":0,\"4\":1}]},\"8\":{\"1\":[{\"1\":2,\"2\":0,\"5\":{\"1\":2,\"2\":0}},{\"1\":0,\"2\":0,\"3\":3},{\"1\":1,\"2\":0,\"4\":1}]},\"9\":0,\"10\":1,\"11\":4,\"12\":0}' data-sheets-textstyleruns='{\"1\":0}î¸{\"1\":360,\"2\":{\"5\":1}}î¸{\"1\":402}'><span>Perfect for newborns weighing 2.5â€“7 kg (0 to 3 months).</span></span><br><span>-Â </span><span>The outer layer, made of velvety soft minky, feels smooth on baby's skin.</span><br>- It is soft, gentle, breathable, and has a velcro closure for easy wearing.<br>- The Newborn UNO comes with one Dry Feel Magic Pad.</p>\n<p><img src=\"https://cdn.shopify.com/s/files/1/0402/7370/7171/files/3dweb_4b564824-bb24-4aae-a174-e580d8d34d89.webp?v=1693216588\" alt=\"\"></p>\n<p>When folded, the Dry Feel Magic Pad has 9 layers of GOTS Certified 100% Organic Cotton - The Super DryFeel Layer on top keeps babyâ€™s bum dry for â€œstay dryâ€ comfort.<strong><br>Note:</strong> The Dry Feel Magic Pad you receive may have Blue or White coloured Super DryFeel Layer, basis stock availability. Rest assured, its super performance and functionality remain exactly the same!</p>\n<p><img alt=\"\" src=\"https://cdn.shopify.com/s/files/1/0402/7370/7171/files/NB1-PDP_2copy.webp?v=1688710994\"><img alt=\"\" src=\"https://cdn.shopify.com/s/files/1/0402/7370/7171/files/NB1-PDP_3copy.webp?v=1688711027\"><img alt=\"\" src=\"https://cdn.shopify.com/s/files/1/0402/7370/7171/files/NB1-PDP_1copy.webp?v=1688711017\"><br><img alt=\"\" src=\"https://cdn.shopify.com/s/files/1/0402/7370/7171/files/No_chem.jpg?v=1660736089\"></p>\n<!-- split -->",
