            "handle": "supersoft-brief-pack-3-boy-4y-8y-bummy-galaxy",
            "body_html": "<p dir=\"ltr\"><span><strong>Contains:</strong><br>- Pack of 3 Briefs<br><br>From a magical land where clouds dance, <strong>Bummy </strong>and friends bring you the <strong>SuperSoft Underwear for kids</strong> â€” sooooo soft, feels like a teddy bear hug!</span></p>\n<p dir=\"ltr\"><b><br></b></p>\n<p dir=\"ltr\"><span>This kidsâ€™ underwear is <strong>3X softer than regular</strong>, made from<strong> 95% Bamboo &amp; 5% Elastane</strong>, tons of love, and a sprinkle of magic. Itâ€™s <strong>super stretchy, breathable, and comfortable.</strong></span></p>\n<p dir=\"ltr\"> </p>\n<p dir=\"ltr\"><span>Why Bamboo? It has <strong>natureâ€™s superpowers!</strong> With its oh-so-soft feel and breezy touch, feels like it floats on the skin. Its <strong>thermoregulatory properties</strong> keep your baby <strong>cool in summer</strong> and <strong>warm in winter</strong> while fighting off those yucky germs and wicking away moisture. Itâ€™s a fabulous choice for <strong>happy bums</strong> all day long!</span><b></b></p>\n<p dir=\"ltr\"> </p>\n<p>With <strong>cool patterns</strong> like <strong>baby bloomers and briefs, boys' trunks and briefs, and girls' bloomers, briefs, and boyshorts,</strong> there's something for everyone. Made in<strong> vibrant colours</strong> with <strong>CPSIA tested safe, Azo-free dyes.</strong> </p>\n<p> </p>\n<p>No more <strong>scratchy tags and itchy stitches!</strong> Only gentle seams and elastics, paired with joy and comfort with every thread.</p>\n<p dir=\"ltr\"><span><br>Get <strong>FREE Funky Tattoos </strong>with every purchase of <strong>SuperSoft Underwear </strong>and double the fun for your little ones.</span></p>\n<p dir=\"ltr\"><span>These tattoos are temporary, skin-friendly and waterproof, ensuring safe and long-lasting play. Simply peel the transparent film, apply the tattoo design-side down on the skin, press a damp cloth for 20 seconds, and reveal the fun!</span></p>",
